You can include a file at compile time by using std::include_str macro. Or you can load a file at runtime by using std::fs::read_to_string function. Many Python files can be included and loaded as modules. If one file depends on another you must preserve correct order while declaring PyModule. Example directory structure: .
├── Cargo.lock
├── Cargo.toml
├── python_app
│ ├── app.py
│ └── utils
│ └── foo.py
└── src └── main.rs python_app/app.py: from utils.foo import bar def run(): return bar() python_app/utils/foo.py: def bar(): return "baz" The example below shows: how to include content of app.py and utils/foo.py into your rust binary how to call function run() (declared in app.py) that needs function imported from utils/foo.py src/main.rs: use pyo3::prelude::*; fn main() -> PyResult<()> { let py_foo = include_str!(concat!( env!("CARGO_MANIFEST_DIR"), "/python_app/utils/foo.py" )); let py_app = include_str!(concat!(env!("CARGO_MANIFEST_DIR"), "/python_app/app.py")); let from_python = Python::with_gil(|py| -> PyResult<Py<PyAny>> { PyModule::from_code(py, py_foo, "utils.foo", "utils.foo")?; let app: Py<PyAny> = PyModule::from_code(py, py_app, "", "")? .getattr("run")? .into(); app.call0(py) }); println!("py: {}", from_python?); Ok(())
} The example below shows: how to load content of app.py at runtime so that it sees its dependencies automatically how to call function run() (declared in app.py) that needs function imported from utils/foo.py It is recommended to use absolute paths because then your binary can be run from anywhere as long as your app.py is in the expected directory (in this example that directory is /usr/share/python_app). src/main.rs: use pyo3::prelude::*;
use pyo3::types::PyList;
use std::fs;
use std::path::Path; fn main() -> PyResult<()> { let path = Path::new("/usr/share/python_app"); let py_app = fs::read_to_string(path.join("app.py"))?; let from_python = Python::with_gil(|py| -> PyResult<Py<PyAny>> { let syspath: &PyList = py.import("sys")?.getattr("path")?.downcast()?; syspath.insert(0, &path)?; let app: Py<PyAny> = PyModule::from_code(py, &py_app, "", "")? .getattr("run")? .into(); app.call0(py) }); println!("py: {}", from_python?); Ok(())
}

