To build a PyO3-based Python extension manually, start by running cargo build as normal in a library project which uses PyO3's extension-module feature and has the cdylib crate type . Once built, symlink (or copy) and rename the shared library from Cargo's target/ directory to your desired output directory: on macOS, rename libyour_module.dylib to your_module.so. on Windows, rename libyour_module.dll to your_module.pyd. on Linux, rename libyour_module.so to your_module.so. You can then open a Python shell in the output directory and you'll be able to run import your_module. If you're packaging your library for redistribution, you should indicated the Python interpreter your library is compiled for by including the platform tag in its name. This prevents incompatible interpreters from trying to import your library. If you're compiling for PyPy you must include the platform tag, or PyPy will ignore the module. Bazel builds To use PyO3 with bazel one needs to manually configure PyO3, PyO3-ffi and PyO3-macros. In particular, one needs to make sure that it is compiled with the right python flags for the version you intend to use. For example see: https://github.com/OliverFM/pytorch_with_gazelle -- for a minimal example of a repo that can use PyO3, PyTorch and Gazelle to generate python Build files. https://github.com/TheButlah/rules_pyo3 -- which has more extensive support, but is outdated. Platform tags Rather than using just the .so or .pyd extension suggested above (depending on OS), you can prefix the shared library extension with a platform tag to indicate the interpreter it is compatible with. You can query your interpreter's platform tag from the sysconfig module. Some example outputs of this are seen below: # CPython 3.10 on macOS
.cpython-310-darwin.so # PyPy 7.3 (Python 3.8) on Linux
$ python -c 'import sysconfig; print(sysconfig.get_config_var("EXT_SUFFIX"))'
.pypy38-pp73-x86_64-linux-gnu.so So, for example, a valid module library name on CPython 3.10 for macOS is your_module.cpython-310-darwin.so, and its equivalent when compiled for PyPy 7.3 on Linux would be your_module.pypy38-pp73-x86_64-linux-gnu.so. See PEP 3149 for more background on platform tags. macOS On macOS, because the extension-module feature disables linking to libpython ( see the next section ), some additional linker arguments need to be set. maturin and setuptools-rust both pass these arguments for PyO3 automatically, but projects using manual builds will need to set these directly in order to support macOS. The easiest way to set the correct linker arguments is to add a build.rs with the following content: fn main() { pyo3_build_config::add_extension_module_link_args();
} Remember to also add pyo3-build-config to the build-dependencies section in Cargo.toml. An alternative to using pyo3-build-config is add the following to a cargo configuration file (e.g. .cargo/config.toml): [target.x86_64-apple-darwin]
rustflags = [ "-C", "link-arg=-undefined", "-C", "link-arg=dynamic_lookup",
] [target.aarch64-apple-darwin]
rustflags = [ "-C", "link-arg=-undefined", "-C", "link-arg=dynamic_lookup",
] Using the MacOS system python3 (/usr/bin/python3, as opposed to python installed via homebrew, pyenv, nix, etc.) may result in runtime errors such as Library not loaded: @rpath/Python3.framework/Versions/3.8/Python3. These can be resolved with another addition to .cargo/config.toml: [build]
rustflags = [ "-C", "link-args=-Wl,-rpath,/Library/Developer/CommandLineTools/Library/Frameworks",
] Alternatively, on rust >= 1.56, one can include in build.rs: fn main() { println!( "cargo:rustc-link-arg=-Wl,-rpath,/Library/Developer/CommandLineTools/Library/Frameworks" );
} For more discussion on and workarounds for MacOS linking problems see this issue . Finally, don't forget that on MacOS the extension-module feature will cause cargo test to fail without the --no-default-features flag (see the FAQ ).

