Let's take a look at a dead simple async Python function: # Sleep for 1 second
async def py_sleep(): await asyncio.sleep(1) Async functions in Python are simply functions that return a coroutine object . For our purposes, we really don't need to know much about these coroutine objects. The key factor here is that calling an async function is just like calling a regular function , the only difference is that we have to do something special with the object that it returns. Normally in Python, that something special is the await keyword, but in order to await this coroutine in Rust, we first need to convert it into Rust's version of a coroutine: a Future. That's where pyo3-asyncio comes in. pyo3_asyncio::into_future performs this conversion for us. The following example uses into_future to call the py_sleep function shown above and then await the coroutine object returned from the call: use pyo3::prelude::*; #[pyo3_asyncio::tokio::main]
async fn main() -> PyResult<()> { let future = Python::with_gil(|py| -> PyResult<_> { // import the module containing the py_sleep function let example = py.import("example")?; // calling the py_sleep method like a normal function // returns a coroutine let coroutine = example.call_method0("py_sleep")?; // convert the coroutine into a Rust future using the // tokio runtime pyo3_asyncio::tokio::into_future(coroutine) })?; // await the future future.await?; Ok(())
} Alternatively, the below example shows how to write a #[pyfunction] which uses into_future to receive and await a coroutine argument: #[pyfunction]
fn await_coro(coro: &PyAny) -> PyResult<()> { // convert the coroutine into a Rust future using the // async_std runtime let f = pyo3_asyncio::async_std::into_future(coro)?; pyo3_asyncio::async_std::run_until_complete(coro.py(), async move { // await the future f.await?; Ok(()) })
} This could be called from Python as: import asyncio async def py_sleep(): asyncio.sleep(1) await_coro(py_sleep()) If for you wanted to pass a callable function to the #[pyfunction] instead, (i.e. the last line becomes await_coro(py_sleep)), then the above example needs to be tweaked to first call the callable to get the coroutine: #[pyfunction]
fn await_coro(callable: &PyAny) -> PyResult<()> { // get the coroutine by calling the callable let coro = callable.call0()?; // convert the coroutine into a Rust future using the // async_std runtime let f = pyo3_asyncio::async_std::into_future(coro)?; pyo3_asyncio::async_std::run_until_complete(coro.py(), async move { // await the future f.await?; Ok(()) })
} This can be particularly helpful where you need to repeatedly create and await a coroutine. Trying to await the same coroutine multiple times will raise an error: RuntimeError: cannot reuse already awaited coroutine If you're interested in learning more about coroutines and awaitables in general, check out the Python 3 asyncio docs for more information.

