} Just like in Python, the following constructs can be part of the signature:: /: positional-only arguments separator, each parameter defined before / is a positional-only parameter. *: var arguments separator, each parameter defined after * is a keyword-only parameter. *args: "args" is var args. Type of the args parameter has to be &PyTuple. **kwargs: "kwargs" receives keyword arguments. The type of the kwargs parameter has to be Option<&PyDict>. arg=Value: arguments with default value. If the arg argument is defined after var arguments, it is treated as a keyword-only argument. Note that Value has to be valid rust code, PyO3 just inserts it into the generated code unmodified. Example: # use pyo3::prelude::*;
