} impl From<OtherError> for MyOtherError { fn from(other: OtherError) -> Self { Self(other) }
} #[pyfunction]
fn wrapped_get_x() -> Result<i32, MyOtherError> { // get_x is a function returning Result<i32, OtherError> let x: i32 = get_x()?; Ok(x)
