#[pyclass]
struct MyClass { my_field: i32,
} // Take a GIL-bound reference when the underlying `PyCell` is irrelevant.
#[pyfunction]
fn increment_field(my_class: &mut MyClass) { my_class.my_field += 1;
} // Take a GIL-bound reference wrapper when borrowing should be automatic,
// but interaction with the underlying `PyCell` is desired.
#[pyfunction]
fn print_field(my_class: PyRef<'_, MyClass>) { println!("{}", my_class.my_field);
} // Take a GIL-bound reference to the underlying cell
// when borrowing needs to be managed manually.
#[pyfunction]
fn increment_then_print_field(my_class: &PyCell<MyClass>) { my_class.borrow_mut().my_field += 1; println!("{}", my_class.borrow().my_field);
} // Take a GIL-indepedent reference when you want to store the reference elsewhere.
#[pyfunction]
fn print_refcnt(my_class: Py<MyClass>, py: Python<'_>) { println!("{}", my_class.get_refcnt(py));
} Classes can also be passed by value if they can be cloned, i.e. they automatically implement FromPyObject if they implement Clone, e.g. via #[derive(Clone)]: # #![allow(dead_code)]
