Currently PyO3 only supports fieldless enums. PyO3 adds a class attribute for each variant, so you can access them in Python without defining #[new]. PyO3 also provides default implementations of __richcmp__ and __int__, so they can be compared using ==: # use pyo3::prelude::*;
#[pyclass]
enum MyEnum { Variant, OtherVariant,
} Python::with_gil(|py| { let x = Py::new(py, MyEnum::Variant).unwrap(); let y = Py::new(py, MyEnum::OtherVariant).unwrap(); let cls = py.get_type::<MyEnum>(); pyo3::py_run!(py, x y cls, r#" assert x == cls.Variant assert y == cls.OtherVariant assert x != y "#)
}) You can also convert your enums into int: # use pyo3::prelude::*;
#[pyclass]
enum MyEnum { Variant, OtherVariant = 10,
} Python::with_gil(|py| { let cls = py.get_type::<MyEnum>(); let x = MyEnum::Variant as i32; // The exact value is assigned by the compiler. pyo3::py_run!(py, cls x, r#" assert int(cls.Variant) == x assert int(cls.OtherVariant) == 10 assert cls.OtherVariant == 10 # You can also compare against int. assert 10 == cls.OtherVariant "#)
}) PyO3 also provides __repr__ for enums: # use pyo3::prelude::*;
#[pyclass]
enum MyEnum{ Variant, OtherVariant,
} Python::with_gil(|py| { let cls = py.get_type::<MyEnum>(); let x = Py::new(py, MyEnum::Variant).unwrap(); pyo3::py_run!(py, cls x, r#" assert repr(x) == 'MyEnum.Variant' assert repr(cls.OtherVariant) == 'MyEnum.OtherVariant' "#)
}) All methods defined by PyO3 can be overridden. For example here's how you override __repr__: # use pyo3::prelude::*;
#[pyclass]
enum MyEnum { Answer = 42,
} #[pymethods]
impl MyEnum { fn __repr__(&self) -> &'static str { "42" }
} Python::with_gil(|py| { let cls = py.get_type::<MyEnum>(); pyo3::py_run!(py, cls, "assert repr(cls.Answer) == '42'")
}) Enums and their variants can also be renamed using #[pyo3(name)]. # use pyo3::prelude::*;
