By default, all `#[pyclass]` types have a default hash implementation from Python. Types which should not be hashable can override this by setting `__hash__` to `None`. This is the same mechanism as for a pure-Python class. This is done like so: # use pyo3::prelude::*;
#
#[pyclass]
struct NotHashable {} #[pymethods]
impl NotHashable { #[classattr] const __hash__: Option<PyObject> = None;
} __lt__(<self>, object) -> object __le__(<self>, object) -> object __eq__(<self>, object) -> object __ne__(<self>, object) -> object __gt__(<self>, object) -> object __ge__(<self>, object) -> object The implementations of Python's "rich comparison" operators <, <=, ==, !=, > and >= respectively. Note that implementing any of these methods will cause Python not to generate a default __hash__ implementation, so consider also implementing __hash__. Return type
The return type will normally be `bool` or `PyResult`, however any Python object can be returned. __richcmp__(<self>, object, pyo3::basic::CompareOp) -> object Implements Python comparison operations (==, !=, <, <=, >, and >=) in a single method. The CompareOp argument indicates the comparison operation being performed. You can use CompareOp::matches to adapt a Rust std::cmp::Ordering result to the requested comparison. This method cannot be implemented in combination with any of __lt__, __le__, __eq__, __ne__, __gt__, or __ge__. Note that implementing __richcmp__ will cause Python not to generate a default __hash__ implementation, so consider implementing __hash__ when implementing __richcmp__. Return type
The return type will normally be `PyResult`, but any Python object can be returned. If you want to leave some operations unimplemented, you can return py.NotImplemented() for some of the operations: use pyo3::class::basic::CompareOp; # use pyo3::prelude::*;
