# #[pyclass]
# struct Number(i32);
#
#[pymethods]
impl Number { fn __richcmp__(&self, other: &Self, op: CompareOp, py: Python<'_>) -> PyObject { match op { CompareOp::Eq => (self.0 == other.0).into_py(py), CompareOp::Ne => (self.0 != other.0).into_py(py), _ => py.NotImplemented(), } }
} If the second argument object is not of the type specified in the signature, the generated code will automatically return NotImplemented. __getattr__(<self>, object) -> object __getattribute__(<self>, object) -> object Differences between `__getattr__` and `__getattribute__`
As in Python, `__getattr__` is only called if the attribute is not found
