use pyo3::types::{PyDict, PyTuple};
use std::cell::Cell; /// A function decorator that keeps track how often it is called.
///
/// It otherwise doesn't do anything special.
#[pyclass(name = "Counter")]
pub struct PyCounter { // Keeps track of how many calls have gone through. // // See the discussion at the end for why `Cell` is used. count: Cell<u64>, // This is the actual function being wrapped. wraps: Py<PyAny>,
} #[pymethods]
impl PyCounter { // Note that we don't validate whether `wraps` is actually callable. // // While we could use `PyAny::is_callable` for that, it has some flaws: // 1. It doesn't guarantee the object can actually be called successfully // 2. We still need to handle any exceptions that the function might raise #[new] fn __new__(wraps: Py<PyAny>) -> Self { PyCounter { count: Cell::new(0), wraps, } } #[getter] fn count(&self) -> u64 { self.count.get() } #[pyo3(signature = (*args, **kwargs))] fn __call__( &self, py: Python<'_>, args: &PyTuple, kwargs: Option<&PyDict>, ) -> PyResult<Py<PyAny>> { let old_count = self.count.get(); let new_count = old_count + 1; self.count.set(new_count); let name = self.wraps.getattr(py, "__name__")?; println!("{} has been called {} time(s).", name, new_count); // After doing something, we finally forward the call to the wrapped function let ret = self.wraps.call(py, args, kwargs)?; // We could do something with the return value of // the function before returning it Ok(ret) }
} #[pymodule]
