The easiest way to convert a Python object to a Rust value is using .extract(). It returns a PyResult with a type error if the conversion fails, so usually you will use something like # use pyo3::prelude::*;
# use pyo3::types::PyList;
# fn main() -> PyResult<()> {
# Python::with_gil(|py| {
# let list = PyList::new(py, b"foo");
let v: Vec<i32> = list.extract()?;
# assert_eq!(&v, &[102, 111, 111]);
# Ok(())
# })
# } This method is available for many Python object types, and can produce a wide variety of Rust types, which you can check out in the implementor list of FromPyObject . FromPyObject is also implemented for your own Rust types wrapped as Python objects (see the chapter about classes ). There, in order to both be able to operate on mutable references and satisfy Rust's rules of non-aliasing mutable references, you have to extract the PyO3 reference wrappers PyRef and PyRefMut . They work like the reference wrappers of std::cell::RefCell and ensure (at runtime) that Rust borrows are allowed. Deriving FromPyObject FromPyObject can be automatically derived for many kinds of structs and enums if the member types themselves implement FromPyObject. This even includes members with a generic type T: FromPyObject. Derivation for empty enums, enum variants and structs is not supported. Deriving FromPyObject for structs The derivation generates code that will attempt to access the attribute my_string on the Python object, i.e. obj.getattr("my_string"), and call extract() on the attribute. use pyo3::prelude::*; #[derive(FromPyObject)]
